import React from 'react';
import Footer from '../components/Footer';
import Upload from '../components/Upload';
import TopMenu from '../components/TopMenu';
import { Grid } from '@material-ui/core';



function Home() {

    return (
        <div>
          <TopMenu/>
          <Grid
              container
              direction="row"
              alignItems="center"
              >
            <div>   
              <Upload/>
              <FileUp/>
            </div> 
          </Grid>
          <Footer/>
        </div>
      )
}

export default Home;
